import React from 'react';
import { View, TextInput, StyleSheet } from 'react-native';

const ArtistForm = () => {
  return (
    <View style={styles.container}>
      {/* Artist-specific fields */}
      <TextInput
        placeholder="First Name"
        style={styles.input}
      />
      <TextInput
        placeholder="Last Name"
        style={styles.input}
      />
      <TextInput
        placeholder="Email"
        style={styles.input}
      />
      <TextInput
        placeholder="Phone"
        style={styles.input}
      />
      <TextInput
        placeholder="City & State, Country"
        style={styles.input}
      />
      <TextInput
        placeholder="Pincode"
        style={styles.input}
      />
      <TextInput
        placeholder="Full Address"
        style={styles.input}
      />
      <TextInput
        placeholder="ID Proof"
        style={styles.input}
      />
      <TextInput
        placeholder="ID Proof Name and Number"
        style={styles.input}
      />
      <TextInput
        placeholder="Proof Upload"
        style={styles.input}
      />
      <TextInput
        placeholder="Age"
        style={styles.input}
      />
      <TextInput
        placeholder="DOB"
        style={styles.input}
      />
      <TextInput
        placeholder="Gender"
        style={styles.input}
      />
      <TextInput
        placeholder="Height"
        style={styles.input}
      />
      <TextInput
        placeholder="Weight"
        style={styles.input}
      />
       <TextInput
        placeholder="Eye Color"
        style={styles.input}
      />
       <TextInput
        placeholder="Hair Color"
        style={styles.input}
      />
        <TextInput
        placeholder="Waist Size"
        style={styles.input}
      />
        <TextInput
        placeholder="Chest Size"
        style={styles.input}
      />
        <TextInput
        placeholder="Hair Length"
        style={styles.input}
      />
        <TextInput
        placeholder="Shoulder Length"
        style={styles.input}
      />
        <TextInput
        placeholder="Dress Size"
        style={styles.input}
      />
        <TextInput
        placeholder="Skin Color"
        style={styles.input}
      />
        <TextInput
        placeholder="Shoes Size"
        style={styles.input}
      />
        <TextInput
        placeholder="Upload Your Photo"
        style={styles.input}
      />
        <TextInput
        placeholder="Professional Status"
        style={styles.input}
      />
        <TextInput
        placeholder="How Does Your Hear About Us"
        style={styles.input}
      />
        <TextInput
        placeholder="All Your Experience"
        style={styles.input}
      />
      <TextInput
        placeholder="All Your Experience"
        style={styles.input}
      />
      <TextInput
        placeholder="ME"
        style={styles.input}
      />
      
    </View>

    
  );
};

const styles = StyleSheet.create({
  container: {
    marginBottom: 20,
  },
  input: {
    borderWidth: 1,
    borderColor: 'gray',
    borderRadius: 5,
    padding: 10,
    marginBottom: 10,
  },
});

export default ArtistForm;
